  false,\n\t\"url\": null,\n\t\"notes\": \"NCEI Accession 0144251 includes discrete
  sample and profile data collected from Sarmiento de Gamboa in the North Atlantic
  Ocean from 2009-07-25 to 2009-08-13. These data include DISSOLVED OXYGEN, HYDROSTATIC
  PRESSURE, NITRATE, Potential temperature (theta), SALINITY, TOTAL ALKALINITY (TA),
  WATER TEMPERATURE, pH, phosphate and silicate. The instruments used to collect these
  data include Alkalinity titrator, CTD, bottle and spectrophotometer.nnThese data
  were collected by Aida F. Rios, Fiz Perez and Miguel - Chief Scientist Gilcoto of
  Instituto de Investigaciones Marinas de Vigo as part of the CLIVAR_CAIBOX_2009 data
  set. CDIAC associated the following cruise ID(s) with this data set: CAIBOX_2009nnThe
  International CLIVAR Global Ocean Carbon and Repeat Hydrography Program carries
  out a systematic and global re-occupation of select WOCE/JGOFS hydrographic sections
  to quantify changes in storage and transport of heat, fresh water, carbon dioxide
  (CO2), and related parameters.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
